var tipuesearch = {"pages":[{"text":"2017Spring 機械設計工程系網際內容管理 課程倉儲: http://github.com/mdecourse/2017springwcm 課程投影片: http://mdecourse.github.io/2017springwcm 課程網誌: http://mdecourse.github.io/2017springwcm/blog","tags":"misc","title":"About","url":"./pages/about/"},{"text":"自行製作網路線 工具: 壓線鉗 接頭 雙絞線 製作步驟: 1.將網路線撥開 2.將網路線按照白橙、橙、白綠、藍、白藍、綠、白棕、棕顏色排好(長度大約1.5公分) 3.插入接頭當中 4.使用壓線鉗就完成了. 而網路線規格分為7級,分別為CAR1-6和5e以下為各階級差異 實際有傳輸訊號和接收訊號的只有4支腳位,分別為1、2、3、6,4、5、7、8是沒有定義的.","tags":"Misc","title":"網路線製作","url":"./wang-lu-xian-zhi-zuo.html"},{"text":"機械設計. 1. 機 :精巧配置之互動元件. 2. 械 :配置之元件所產生的特定功能,解決問題. 3. 設 :表達結果. 4. 計 許多的思考和討論. 我們來到機械設計系,就是希望未來能成為一位虛實整合的機械工程師,除了能夠做出實際的機械結構,更能夠將軟體和程式運用自如,才能在這數位化的時代能夠謀得一份良好的工作.","tags":"Misc","title":"何謂機械設計","url":"./he-wei-ji-jie-she-ji.html"}]};